package org.brainteam.lunchbox.json;public class JsonOrder {		private Long id;	private JsonOrdererDetail detail;	private JsonOfferItemInfo offerItem;		public Long getId() {		return id;	}		public void setId(Long id) {		this.id = id;	}		public JsonOrdererDetail getDetail() {		return detail;	}		public void setDetail(JsonOrdererDetail detail) {		this.detail = detail;	}		public JsonOfferItemInfo getOfferItem() {		return offerItem;	}		public void setOfferItem(JsonOfferItemInfo offerItem) {		this.offerItem = offerItem;	}	}